import React from 'react';
import RepoItem from './RepoItem';
import PropTypes from 'prop-types';

const Repos = ({ repos }) => {
  return repos.map((repo) => <RepoItem repo={repo} />);
};

Repos.prototype = {
  repos: PropTypes.array.isRequired,
};

export default Repos;
